import React from "react";

const Song = () => {
    return (
        <div className="text-center mb-6">
            <img
                src="https://i1.sndcdn.com/artworks-000635457925-lc2qoe-t500x500.jpg"
                alt="cover"
                className="w-40 h-40 mx-auto rounded-full shadow-lg mb-4"
            />
            <h2 className="text-2xl font-semibold">Peaceful Vibes</h2>
            <p className="text-gray-500">Lo-Fi Artist</p>
        </div>
    );
};

export default Song;
